def bingo():
    card = []
    for _ in range(3):
        row = list(map(int, input().split()))
        card.append(row)
    N = int(input())
    for _ in range(N):
        num = int(input())
        for i in range(3):
            for j in range(3):
                if card[i][j] == num:
                    card[i][j] = 0
    if card[0][0] == 0 and card[1][1] == 0 and card[2][2] == 0:
        print("Yes")
        return
    if card[0][2] == 0 and card[1][1] == 0 and card[2][0] == 0:
        print("Yes")
        return
    for i in range(3):
        if card[i][0] == 0 and card[i][1] == 0 and card[i][2] == 0:
            print("Yes")
            return
        if card[0][i] == 0 and card[1][i] == 0 and card[2][i] == 0:
            print("Yes")
            return
    print("No")

bingo()

